import React from 'react'
import { Box, BottomNavigation, BottomNavigationAction, Paper } from "@material-ui/core"
import { AddCircleSharp, CreateSharp, SearchSharp, DeleteSharp, FormatAlignCenter } from "@material-ui/icons"

const [value, setValue] = ['test1', 'test2']
class Item extends React.Component {
  render() {
    return (
      <Box sx={{ width: 400 , alignContent : cen}}>
        <Paper style={{ margin: 16, padding: 16 }}>
          <BottomNavigation
            showLabels
            value={value}
            sx={{ width: 500 }}
            onChange={(event, newValue) => {
              setValue(newValue);
            }}
          >
            <BottomNavigationAction
              label="제품 추가"
              icon={<AddCircleSharp />}
            />
            <BottomNavigationAction label="제품 검색" icon={<SearchSharp />} />
            <BottomNavigationAction label="제품 수정" icon={<CreateSharp />} />
            <BottomNavigationAction label="제품 삭제" icon={<DeleteSharp />} />
          </BottomNavigation>
        </Paper>
      </Box>
    );
  }
}

export default Item;
